import React, {  useEffect, useState } from 'react';
import './App.css';
import Login from './Component/Login';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import ControlPanel from './Component/ControlPanel';



function App() {
 const [fly, setFly] = useState("")
 const flyts = [
  {flytN:123, company:"abc",passengerN:100},
  {flytN:345, company:"def",passengerN:200},
  {flytN:567, company:"ghi",passengerN:300},
  {flytN:789, company:"jkl",passengerN:400}
]



  return (
    <div className="App">
    <Router>
         <Routes>
            <Route path='/' element ={<Login />}/>
            <Route path='/controlpanel' element ={<ControlPanel flyts = {flyts}/>}/>
         </Routes> 
      </Router>
    </div>
  );
}

export default App;
